import { httpaxios } from '../../axios/config'
import Axios from 'axios'

const URI = '/document'

export default {
  salvar: (arquivo) => {
    return httpaxios.post(URI, { headers: { Authorization: `Bearer ${token}` } }).then((res) => {
      console.log('RESPONSE RECEIVED: ', res)
    })
      .catch((err) => {
        console.log('AXIOS ERROR: ', err)
      })
  }
}
